if (bpm_package.children[0] != null)
{
	var temp_length = bpm_package.children.length;
	for (var i = 1; i <= temp_length; i++)
	{	
		if (execution.getVariable('workflowinstanceid') != bpm_package.children[temp_length - i].properties["psdoc:initiatingDocWorkflowID"]) 
 		{
			//remove doc from workflow
			bpm_package.removeNode(bpm_package.children[temp_length - i]);
			bpm_package.save();
		}
	}
}

if (bpm_package.children[0] != null)
{
	for (var i = 0; i < bpm_package.children.length; i++)
	{
       	 if (execution.getVariable('pswf_taskNumber') == bpm_package.children[i].properties["psdoc:taskNumber"] && bpm_package.children[i].getTypeShort() != "psform:newPayrollStarterForm")
       	 {
            		bpm_package.children[i].properties["psdoc:status"] = "Final";
            		bpm_package.children[i].save();
			//don't lock if cashfac backing doc
			if(bpm_package.children[i].properties["psdoc:type"].indexOf('CashFac Payment Paperwork') == -1){
				customLockService.lockNode(bpm_package.children[i].nodeRef);
			}

        	}
	}
}

if (bpm_package.children[0] != null)
{
	for (var i = 1; i <= bpm_package.children.length; i++)
	{	
			//delete document
			bpm_package.children[i-1].remove()
	}
}

